import React, { Component } from "react";
import Navigation from "../Navbar";
import { Jumbotron, Form, InputGroup, Button, Col, Row } from "react-bootstrap";

class UserHome extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <Navigation></Navigation>
        <Jumbotron>
          <h1>Who delivers your favourite food?</h1>
          <Form>
            <Form.Group as={Row}>
              <InputGroup as={Col}>
                <InputGroup.Prepend>
                  <InputGroup.Text id="inputGroupPrepend">
                    <i class="search icon"></i>
                  </InputGroup.Text>
                </InputGroup.Prepend>
              </InputGroup>
              <Form.Control
                as={Col}
                placeholder="Search with item"
                aria-describedby="inputGroupPrepend"
              ></Form.Control>
              <Form.Control
                as={Col}
                placeholder="Search with Cuisine"
              ></Form.Control>
              <Button as={Col}>Find Food</Button>
            </Form.Group>
          </Form>
        </Jumbotron>
      </div>
    );
  }
}

export default UserHome;
